CREATE TABLE #Paritioninfo ( [Schema] SYSNAME , [Table] SYSNAME , [PartitionNumber] INT , [PartitionRange] SQL_VARIANT , [IndexID] INT , [IndexType] NVARCHAR(60) , [DataCompression] NVARCHAR(60) , [FileGroupName] SYSNAME , [IsFileGroupReadOnly] BIT , [#Rows] BIGINT , [AvgFragmentation] FLOAT , [FragmentCount] BIGINT , [AvgFragmentSizeInPages] FLOAT , [PageCount] BIGINT );
INSERT INTO #Paritioninfo EXECUTE [Reports].[GetPartitionInfo];
SELECT [Schema] , [Table] , [PartitionNumber] , [PartitionRange] = CAST ( [PartitionRange] AS DATETIME2(3) ) , [IndexID] , [IndexType] , [DataCompression] , [FileGroupName] , [IsFileGroupReadOnly] , [#Rows] , [AvgFragmentation] , [FragmentCount] , [AvgFragmentSizeInPages] , [PageCount] FROM #Paritioninfo WHERE [Schema] = N'Fact' AND [Table] = N'Order' AND [IndexID] = 1 ORDER BY [PartitionNumber] ASC;
DROP TABLE #Paritioninfo;

